import React from 'react';
import { LoginButton, LogoutButton } from '../../components';

const Login = () => {
  return (
    <div>
      <h1>Find the contracts you've been looking for</h1>
      <div>
        <LoginButton />
        <LogoutButton />
      </div>
    </div>
  );
};

export default Login;
